import styled from "styled-components";

function Header() {
  return <Container></Container>;
}

const Container = styled.div`
  background-color: #ddd;
`;

const Wrapper = styled.div`
  max-width: 1200px;
  height: 60px;
  background-color: #eee;
`;

export default Header;
